import React from "react";
import { MarkerWrapper, Marker, H1 } from "./styles";

const ProjectMarker = ({ project }) => {
  return (
    <MarkerWrapper>
      <Marker />
      <H1 dangerouslySetInnerHTML={{ __html: project.properties.alt }} />
    </MarkerWrapper>
  );
};

export default ProjectMarker;
